import React, { useEffect, useState } from "react";
import Myheader from "./header";
import { Link } from "react-router-dom";

const MyResume = () => {
  let [pdata, updatPdata] = useState([]);
  let [ctcdata, updatCtcdata] = useState([]);
  let [edudata, updatEdudata] = useState([]);
  let [skldata, updatSkldata] = useState([]);
  const getPersonalData = () => {
    var url1 = "http://localhost:1240/personal";

    fetch(url1)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatPdata(arrayPdada);
      });
  };
  const getContactData = () => {
    var url2 = "http://localhost:1240/contact";

    fetch(url2)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatCtcdata(arrayPdada);
      });
  };
  const getEducationData = () => {
    var url3 = "http://localhost:1240/education";

    fetch(url3)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatEdudata(arrayPdada);
      });
  };
  const getSkillData = () => {
    var url4 = "http://localhost:1240/skills";

    fetch(url4)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatSkldata(arrayPdada);
      });
  };
  useEffect(() => {
    getPersonalData();
    getContactData();
    getEducationData();
    getSkillData();
    console.log(pdata[1]);
  }, [1]);
  return (
    <div className="container mt-4 p-4 rounded">
      <div className="row mt-5 mb-2">
        <div className="col-lg-12">
          <h2 className="text-center text-info">My Resume</h2>
        </div>
      </div>

      <div className="row">
        <div className="col-lg-6">
          {pdata.map((pinfo, index) => {
            return (
              <div className=" text-primary shadow-lg text-right">
                <ul className="list-group">
                  <li className="list-group-item active ">
                    Personal Details
                    <button className="btn btn-warning float-end">Edit</button>
                  </li>
                  <li className="list-group-item">
                    Full Name : {pinfo.fullname}
                  </li>
                  <li className="list-group-item">
                    <b>Gender :</b> <span className="ml-2">{pinfo.gender}</span>
                  </li>
                  <li className="list-group-item ">Age : {pinfo.age}</li>
                  <li className="list-group-item ">Mobile : {pinfo.mobile}</li>
                  <li className="list-group-item ">Email : {pinfo.email}</li>
                </ul>
              </div>
            );
          })}
        </div>
        <div className="col-lg-6">
          {edudata.map((edata, index) => {
            return (
              <div className=" text-primary shadow-lg text-right">
                <ul className="list-group">
                  <li className="list-group-item active ">
                    Contact Details
                    <button className="btn btn-warning float-end">Edit</button>
                  </li>
                  <li className="list-group-item">City : </li>
                  <li className="list-group-item">Address : </li>
                </ul>
              </div>
            );
          })}
        </div>
      </div>
      <div className="row mt-4">
        <div className="col-lg-6">
          {edudata.map((edata, index) => {
            return (
              <div className=" text-primary shadow-lg text-right">
                <ul className="list-group">
                  <li className="list-group-item active ">
                    Education Details
                    <button className="btn btn-warning float-end">Edit</button>
                  </li>
                  <li className="list-group-item">10th Marks : </li>
                  <li className="list-group-item">12th Marks : </li>
                  <li className="list-group-item ">Highest Edu : </li>
                  <li className="list-group-item ">Passing Year :</li>
                  <li className="list-group-item ">Percentage :</li>
                </ul>
              </div>
            );
          })}
        </div>
        <div className="col-lg-6">
          {edudata.map((edata, index) => {
            return (
              <div className=" text-primary shadow-lg text-right">
                <ul className="list-group">
                  <li className="list-group-item active ">
                    My Skills & Experience
                    <button className="btn btn-warning float-end">Edit</button>
                  </li>
                  <li className="list-group-item">Work Experience : </li>
                  <li className="list-group-item">Skills : </li>
                </ul>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default MyResume;
